[100032] = {id = 100032,	scroll = 100001,	type = 15,	teacheid = 0,	name = "2-12",	cname = "偏移的軌跡",	plot_first = "s_11",	plot_last = "0",	map = "yueqiubiaomian_boss",	bgm = "9-Battle-niai",	unlock = "0_1",	front = "100031",	open = "100033_100001",	player = "0",	monster = "600000_3_8_0_1_8_1_0_100355_4000_0_0_0_0",	consume = "4_100001_8",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "4_500000_1,1_110031_3,1_100000_50,1_100001_5000",	drop = "0",	victory = "4_100000_80,1_100001_320",	roleexp = "4_100002_80",	failure = "4_100001_8",	introduction = "4月30日下午2點58分48秒，在謎之聲的幫助下，DOMINATOR成功發射……人類終於迎來了漫長的戰爭的勝利，但是為什麼！！……為什麼逆轉錄光線射偏了？！第一發光束，僅僅只摧毀了逆愛身邊的一扇【門】",	prohibit = "220307;210806;200303;200304;201104;210306",	scrollmappos = "0",	prohibitskill = "220307;210806;200303;200304;201104;210306",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 6,	recomlevel = 0,	bgpicture = "dialog_s-11",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "shidifenni",	promptdialog = "通關2-12後解鎖戰鬥掃蕩",	returnfloorid = 0,	continuouscombattype = 1,	activitypreview2 = "0",	"偏移的轨迹",	"0",	"\u{3000}\u{3000}4月30日下午2点58分48秒，在谜之声的帮助下，DOMINATOR成功发射……人类终于迎来了漫长的战争的胜利，但是为什么！！……为什么逆转录光线射偏了？！第一发光束，仅仅只摧毁了逆爱身边的一扇【门】"},
