[100039] = {id = 100039,	scroll = 100001,	type = 2,	teacheid = 0,	name = "2-19",	cname = "重啟Remake",	plot_first = "s_15",	plot_last = "0",	map = "0",	bgm = "4-Battle-moon_MP3",	unlock = "0_1",	front = "100038",	open = "100100_100010",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "一切都已經結束了，我已經什麼都做不到了……在彌留之際，我仿佛幻視一般，看見了雙子的原罪，她們在詢問我，是否想要再來一次的機會……是否想要……挽回這一切……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-15",	npctype = 0,	npcbanmove = "0",	playnumber = 6,	recomlevel = 0,	bgpicture = "dialog_s-15",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "shidifenni",	promptdialog = "通關2-19後解鎖活動與困難本",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"重启Remake",	"0",	"\u{3000}\u{3000}一切都已经结束了，我已经什么都做不到了……在弥留之际，我仿佛幻视一般，看见了双子的原罪，她们在询问我，是否想要再来一次的机会……是否想要……挽回这一切……"},
[100100] = {id = 100100,	scroll = 100010,	type = 2,	teacheid = 0,	name = "3-1",	cname = "“噩夢”",	plot_first = "1_1",	plot_last = "0",	map = "0",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100039",	open = "100101_100010",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "從一場噩夢中掙脫出來，我被驚醒了，但任憑我如何回憶，卻記不起半點內容，隨後響起的警告聲提示著我，多瑙支部負責的區域遭受了原罪的入侵，作為一名【領航】，我需要行動起來……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_1-1",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-1",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "shidifenni",	promptdialog = "通關3-3後解鎖指揮室",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"“噩梦”",	"0",	"\u{3000}\u{3000}从一场噩梦中挣脱出来，我被惊醒了，但仍凭我如何回忆，却记不起半点内容，随后响起的警告声提示着我，多瑙支部负责的区域遭受了原罪的入侵，作为一名【领航】，我需要行动起来……"},
[100101] = {id = 100101,	scroll = 100010,	type = 0,	teacheid = 0,	name = "3-2",	cname = "低等原罪",	plot_first = "1_2",	plot_last = "0",	map = "haigang_yewan",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100100",	open = "100102_100010",	player = "0",	monster = "230002_1_23_0_2_12_1_0_100020_1800_0_100220_400_0;210003_1_23_0_2_10_1_0_100020_1800_0_100220_400_0;220008_2_20_0_2_7_1_0_100020_1800_0_100220_400_0;220008_3_18_0_2_4_1_0_100020_1800_0_100220_400_0;220008_2_20_0_2_16_1_0_100020_1800_0_100220_400_0;210003_1_23_0_2_2_1_0_100020_1800_0_100220_400_0;210003_1_23_0_2_5_1_0_100020_1800_0_100220_400_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "1_100000_30,1_110010_5,1_100001_3000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "當原罪的恐懼籠罩在人們頭上時，一部分人選擇逃跑時，另一部分人便會選擇迎擊。我從戰場上拯救了一位士兵，他便是選擇迎擊的其中之一，隨後，在原罪的攻擊下，我的小隊的第一位成員也登場了……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-2",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "shidifenni",	promptdialog = "通關3-3後解鎖指揮室",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"低等原罪",	"0",	"\u{3000}\u{3000}当原罪的恐惧笼罩在人们头上时，一部分人选择逃跑时，另一部分人便会选择迎击。我从战场上拯救了一位士兵，他便是选择迎击的其中之一，随后，在原罪的攻击下，我的小队的第一位成员也登场了……"},
