[100103] = {id = 100103,	scroll = 100010,	type = 0,	teacheid = 0,	name = "3-4",	cname = "特別聯合",	plot_first = "1_3",	plot_last = "0",	map = "haigang_yewan",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100102",	open = "100104_100010",	player = "0",	monster = "230002_1_25_0_2_10_1_0_100020_1800_0_100220_400_0;210009_2_21_0_2_4_1_0_100020_1800_0_100220_400_0;230002_1_25_0_2_9_1_0_100020_1800_0_100220_400_0;210009_2_21_0_2_1_1_0_100020_1800_0_100220_400_0;220005_1_25_0_2_17_1_0_100020_1800_0_100220_400_0;210016_3_19_0_2_13_1_0_100020_1800_0_100220_400_0;220005_1_25_0_2_16_1_0_100020_1800_0_100220_400_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "1_100000_30,1_110081_5,1_100001_3000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "在朱利烏斯颯爽登場之後，陸續著又來了兩名巨大化的少女。一等兵查麗莎·德·洛蘭與支援型的弗蘭卡，就她們的戰鬥特性我開始擬定剿滅原罪、拯救平民的辦法，希望她們接下的相處能融洽一點。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-3",	reserve = "0",	dangerousenemy = "13_210016",	npcheads = "shidifenni",	promptdialog = "通關3-5後解鎖指揮室維護池",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"特别联合",	"0",	"\u{3000}\u{3000}在朱利乌斯飒爽登场之后，陆续着又来了两名巨大化的少女。一等兵查丽莎·德·洛兰与支援型的弗兰卡，就她们的战斗特性我开始拟定剿灭原罪、拯救平民的办法，希望她们接下的相处能融洽一点。"},
