[100106] = {id = 100106,	scroll = 100010,	type = 0,	teacheid = 0,	name = "3-7",	cname = "匯聚之處",	plot_first = "1_6",	plot_last = "0",	map = "haigang_yewan",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100105",	open = "100107_100010",	player = "0",	monster = "220008_2_23_0_2_14_1_0_100020_2100_0_100220_400_0;220008_2_23_0_2_5_1_0_100020_2100_0_100220_400_0;210016_3_21_0_2_9_1_0_100020_2100_0_100220_400_0;210003_1_27_0_2_2_1_0_100020_2100_0_100220_400_0;210003_1_27_0_2_10_1_0_100020_2100_0_100220_400_0;210003_1_27_0_2_7_1_0_100020_2100_0_100220_400_0;210003_1_27_0_2_1_1_0_100020_2100_0_100220_400_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "1_100000_30,1_110081_5,1_100001_3000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "弗蘭卡及時趕到拯救了這對母女，但是人們對巨大少女這一技術有所瞭解，也明確地知道她們是人類這件事，可真正面對這些少女的時候，這位母親還是遲疑了，最終弗蘭卡真切的眼神讓母女接受了她的幫助",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-6",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"汇聚之处",	"0",	"\u{3000}\u{3000}弗兰卡及时赶到拯救了这对母女，但是人们对巨大少女这一技术有所了解，也明确地知道她们是人类这件事，可真正面对这些少女的时候，这位母亲还是迟疑了，最终弗兰卡真切的眼神让母女接受了她的帮助"},
