[100108] = {id = 100108,	scroll = 100010,	type = 2,	teacheid = 0,	name = "3-9",	cname = "合理安排",	plot_first = "1_8",	plot_last = "0",	map = "0",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100107",	open = "100109_100010",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "朱利烏斯穩定下來之後，查麗莎的不滿又通過聯絡裝置傳遞過來，她似乎對於自己不能在正面作戰十分不滿，僅僅在側翼遊走並不能發揮她的全部戰力……真是的，一意孤行在任何時候都不是好性格，真希望她改掉。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_1-8",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-8",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"合理安排",	"0",	"\u{3000}\u{3000}朱利乌斯稳定下来之后，查丽莎的不满又通过联络装置传递过来，她似乎对于自己不能在正面作战十分不满，仅仅在侧翼游走并不能发挥她的全部战力……真是的，一意孤行在任何时候都不是好性格，真希望她改掉。"},
