[100112] = {id = 100112,	scroll = 100010,	type = 2,	teacheid = 0,	name = "3-13",	cname = "分歧點",	plot_first = "1_10",	plot_last = "0",	map = "0",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100111",	open = "100113_100010",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "火力全開的查麗莎，確實讓我見識到了什麼是真正的【超高速戰鬥】，但是，她這份神勇的表現並不能讓我安心，倒不如說，讓我心中的不安加劇了。一隻蜘蛛型原罪在我們爭論的時候出現了……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_1-10",	npctype = 0,	npcbanmove = "0",	playnumber = 7,	recomlevel = 0,	bgpicture = "dialog_1-10",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"分歧点",	"0",	"\u{3000}\u{3000}火力全开的查丽莎，确实让我见识到了什么是真正的【超高速战斗】，但是，她这份神勇的表现并不能让我安心，倒不如说，让我心中的不安加剧了。一只蜘蛛型原罪在我们争论的时候出现了……"},
