[100128] = {id = 100128,	scroll = 100011,	type = 0,	teacheid = 0,	name = "4-10",	cname = "准罪級",	plot_first = "1_15",	plot_last = "0",	map = "haigang_huanghun",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100127",	open = "100129_100011",	player = "0",	monster = "230009_2_41_0_2_3_1_0_100030_3100_0_100230_500_0;200001_2_41_0_2_5_1_0_100030_3100_0_100230_500_0;230006_2_35_0_2_1_1_0_100030_3100_0_100230_500_0;210008_2_35_0_2_8_1_0_100030_3100_0_100230_500_0;230009_2_41_0_2_17_1_0_100030_3100_0_100230_500_0;210015_3_31_0_2_14_1_0_100030_3100_0_100230_500_0;210002_2_41_0_2_12_1_0_100030_3100_0_100230_500_0;210002_2_41_0_2_10_1_0_100030_3100_0_100230_500_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "1_100000_30,1_110081_5,1_100001_3000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "我一直以來的擔憂成為了現實，准罪級原罪——【索貝克】從海中登陸了，地面部隊的常規火力無法對它造成一絲一毫的傷害，反而激怒了它，而在它發洩一通吼，把目光放在正在撤離的我們身上。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 8,	recomlevel = 0,	bgpicture = "dialog_1-15",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"准罪级",	"0",	"\u{3000}\u{3000}我一直以来的担忧成为了现实，准罪级原罪——【索贝克】从海中登陆了，地面部队的常规火力无法对它造成一丝一毫的伤害，反而激怒了它，而在它发泄一通吼，把目光放在正在撤离的我们身上。"},
