[100132] = {id = 100132,	scroll = 100011,	type = 0,	teacheid = 0,	name = "4-14",	cname = "士兵",	plot_first = "0",	plot_last = "1_17e",	map = "haigang_huanghun",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100131",	open = "100133_100011",	player = "0",	monster = "200009_2_43_0_2_9_1_0_100030_3300_0_100030_500_0;200001_2_43_0_2_3_1_0_100030_3300_0_100230_500_0;210015_2_37_0_2_5_1_0_100030_3300_0_100230_500_0;230009_2_43_0_2_7_1_0_100030_3300_0_100230_500_0;210008_2_37_0_2_14_1_0_100030_3300_0_100230_500_0;220000_2_43_0_2_13_1_0_100030_3300_0_100230_500_0;210015_3_33_0_2_1_1_0_100030_3300_0_100230_500_0;210008_2_43_0_2_11_1_0_100030_3300_0_100230_500_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "1_100000_30,1_110071_5,1_100001_3000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "所幸的是，我之前救下的士兵此時接過了了帶領人群撤離的任務，托他的福，我們這邊也能好好地戰鬥。儘管，我們與他們並不屬於一個體制，但，我們的目的是相同的，這就足夠了……【索貝爾】討伐戰正式開始。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 8,	recomlevel = 0,	bgpicture = "dialog_1-17",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"士兵",	"0",	"\u{3000}\u{3000}所幸的是，我之前救下的士兵此时接过了了带领人群撤离的任务，托他的福，我们这边也能好好地战斗。尽管，我们与他们并不属于一个体制，但，我们的目的是相同的，这就足够了……【索贝尔】讨伐战正式开始。"},
[100133] = {id = 100133,	scroll = 100011,	type = 2,	teacheid = 0,	name = "4-15",	cname = "阻截戰",	plot_first = "1_18",	plot_last = "0",	map = "0",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100132",	open = "100134_100011",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "強敵帶給我們的壓迫感、生死感，讓人窒息，但同時，經過重重篩選進入這支特別小隊性格迥異的三人卻因此開始磨合，小隊的雛形在這場遭遇戰中顯現，我們將會跨過這道難關，把准罪級原罪【索貝爾】化為“食糧”。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_1-18",	npctype = 0,	npcbanmove = "0",	playnumber = 8,	recomlevel = 0,	bgpicture = "dialog_1-18",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"阻截战",	"0",	"\u{3000}\u{3000}强敌带给我们的压迫感、生死感，让人窒息，但同时，经过重重筛选进入这支特别小队性格迥异的三人却因此开始磨合，小队的雏形在这场遭遇战中显现，我们将会跨过这道难关，把准罪级原罪【索贝尔】化为“食粮”。"},
[100134] = {id = 100134,	scroll = 100011,	type = 15,	teacheid = 0,	name = "4-16",	cname = "化身為怪物",	plot_first = "1_19",	plot_last = "0",	map = "haigang_boss_huanghun",	bgm = "15-Battle-Sobek_MP3",	unlock = "0_1",	front = "100133",	open = "100135_100011",	player = "0",	monster = "600001_3_35_0_5_8_1_0_100155_675_0_100355_675_0",	consume = "4_100001_12",	frequency = 0,	condition = "0_9_1,2_45_32,0_2_12",	reward = "4_500001_1,1_110031_3,1_100000_50,1_100001_5000",	drop = "0",	victory = "4_100000_120,1_100001_480",	roleexp = "4_100002_120",	failure = "4_100001_12",	introduction = "我準備把戰線拉扯到海邊，這樣需要顧及的東西就少了很多，駕駛員們開始不斷地配合著，為了打倒怪物——自身不惜化為怪物，這就是我們人類啊……",	prohibit = "220307;210806;200303;200304;201104;210306",	scrollmappos = "0",	prohibitskill = "220307;210806;200303;200304;201104;210306",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 8,	recomlevel = 0,	bgpicture = "dialog_1-19",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 1,	activitypreview2 = "0",	"化身为怪物",	"0",	"\u{3000}\u{3000}我准备把战线拉扯到海边，这样需要顾及的东西就少了很多，驾驶员们开始不断地配合着，为了打倒怪物——自身不惜化为怪物，这就是我们人类啊……"},
[100135] = {id = 100135,	scroll = 100011,	type = 2,	teacheid = 0,	name = "4-17",	cname = "生還者",	plot_first = "1_20",	plot_last = "0",	map = "0",	bgm = "19-Battle-Warehouse_MP3",	unlock = "0_1",	front = "100134",	open = "100200_100020",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "多瑙特別聯合部隊的首戰，以准罪級原罪【索貝爾】的死亡告捷，但是濃霧卻尚未散開，從霧中又有一道巨大的身影緩緩走出，是一位傷痕累累的少女……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_1-20",	npctype = 0,	npcbanmove = "0",	playnumber = 8,	recomlevel = 0,	bgpicture = "dialog_1-20",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"生还者",	"0",	"\u{3000}\u{3000}多瑙特别联合部队的首战，以准罪级原罪【索贝尔】的死亡告捷，但是浓雾却尚未散开，从雾中又有一道巨大的身影缓缓走出，是一位伤痕累累的少女……"},
[100200] = {id = 100200,	scroll = 100020,	type = 2,	teacheid = 0,	name = "5-1",	cname = "與會人員",	plot_first = "2_1",	plot_last = "0",	map = "0",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100135",	open = "100201_100020",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "多洛莉絲，她是第三研究室防衛隊的駕駛員，也是在霧中被我們救出的少女，我們從她口中得知了濃霧仍未散去的真相，又有一隻【高等原罪】誕生了。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_2-1",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-1",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"与会人员",	"0",	"\u{3000}\u{3000}多洛莉丝，她是第三研究室防卫队的驾驶员，也是在雾中被我们救出的少女，我们从她口中得知了浓雾仍未散去的真相，又有一只【高等原罪】诞生了。"},
[100201] = {id = 100201,	scroll = 100020,	type = 2,	teacheid = 0,	name = "5-2",	cname = "記憶失卻",	plot_first = "2_2",	plot_last = "0",	map = "0",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100200",	open = "100202_100020",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "出擊前的準備，多洛莉絲似乎因為蒼霧的影響什麼都想不起來了，她似乎認為自己是第三研究室防衛隊的逃兵，大家並不那麼認為，並且開始開導多洛莉絲……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_2-2",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-2",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"记忆失却",	"0",	"\u{3000}\u{3000}出击前的准备，多洛莉丝似乎因为苍雾的影响什么都想不起来了，她似乎认为自己是第三研究室防卫队的逃兵，大家并不那么认为，并且开始开导多洛莉丝……"},
