[100223] = {id = 100223,	scroll = 100020,	type = 0,	teacheid = 0,	name = "5-24",	cname = "第一類接觸",	plot_first = "0",	plot_last = "2_9e",	map = "haizhan_yewan",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100222",	open = "100224_100020",	player = "0",	monster = "210009_2_47_0_3_3_1_0_100031_4100_0_100240_1500_0;220005_2_50_0_3_2_1_0_100031_4100_0_100240_1500_0;200012_2_50_0_3_18_1_0_100031_4100_0_100240_1500_0;220003_2_50_0_3_6_1_0_100031_4100_0_100240_1500_0;200008_3_42_0_3_16_1_0_100031_4100_0_100240_1500_0;220009_2_47_0_3_12_1_0_100031_4100_0_100240_1500_0;210015_3_42_0_3_17_1_0_100031_4100_0_100240_1500_0;220005_2_50_0_3_1_1_0_100031_4100_0_100240_1500_0;210009_2_47_0_3_8_1_0_100031_4100_0_100240_1500_0",	consume = "4_100001_16",	frequency = 0,	condition = "0_9_1,2_40_19,0_2_12",	reward = "1_100000_30,1_110082_5,1_100001_3000",	drop = "0",	victory = "4_100000_160,1_100001_640",	roleexp = "4_100002_160",	failure = "4_100001_16",	introduction = "我們與海蛇般的巨大原罪展開了交鋒，但是我們之前已經經歷過幾輪戰鬥，剩下的尼姆比斯液不足以支撐我們進行一場討伐戰，在查麗莎找到機會給予巨大原罪創傷的時候，我們選擇了迅速撤離……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-9",	reserve = "0",	dangerousenemy = "16_200008",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"第一类接触",	"0",	"\u{3000}\u{3000}我们与海蛇般的巨大原罪展开了交锋，但是我们之前已经经历过几轮战斗，剩下的尼姆比斯液不足以支撑我们进行一场讨伐战，在查丽莎找到机会给予巨大原罪创伤的时候，我们选择了迅速撤离……"},
[100224] = {id = 100224,	scroll = 100020,	type = 2,	teacheid = 0,	name = "5-25",	cname = "幕間Ⅰ",	plot_first = "2_10",	plot_last = "0",	map = "0",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100223",	open = "100225_100020",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "恐懼、絕望、哀痛，以及——勇氣，這是我對這段記憶主觀到可以說是一己之見的印象，第三研究院防衛隊隊長，安潔莉卡的故事拉開了序幕，而又快速落幕……真的落幕了嗎……？",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_2-10",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-10",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"幕间Ⅰ",	"0",	"\u{3000}\u{3000}恐惧、绝望、哀痛，以及——勇气，这是我对这段记忆主观到可以说是一己之见的印象，第三研究院防卫队队长，安洁莉卡的故事拉开了序幕，而又快速落幕……真的落幕了吗……？"},
[100225] = {id = 100225,	scroll = 100020,	type = 0,	teacheid = 0,	name = "5-26",	cname = "逃走的意義",	plot_first = "2_11",	plot_last = "0",	map = "haizhan_yewan",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100224",	open = "100226_100020",	player = "0",	monster = "210015_3_42_0_3_14_1_0_100031_4100_0_100240_1500_0;220009_2_47_0_3_12_1_0_100031_4100_0_100240_1500_0;200008_3_42_0_3_5_1_0_100031_4100_0_100240_1500_0;210009_2_47_0_3_2_1_0_100031_4100_0_100240_1500_0;210009_2_47_0_3_3_1_0_100031_4100_0_100240_1500_0;220005_2_50_0_3_9_1_0_100031_4100_0_100240_1500_0;220005_2_50_0_3_18_1_0_100031_4100_0_100240_1500_0;200012_2_50_0_3_7_1_0_100031_4100_0_100240_1500_0;220003_2_50_0_3_16_1_0_100031_4100_0_100240_1500_0",	consume = "4_100001_16",	frequency = 0,	condition = "0_9_1,2_40_19,0_2_12",	reward = "1_100000_30,1_110072_5,1_100001_3000",	drop = "0",	victory = "4_100000_160,1_100001_640",	roleexp = "4_100002_160",	failure = "4_100001_16",	introduction = "我們在蒼霧的週邊遇見了等待著我們的月冕小隊，此時的多洛莉絲也終於從痛苦中緩和了過了，並找回了屬於她的記憶，屬於她的使命——她是一一枚鑰匙，只有她能開通通往第三實驗室的大門。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "icon_storm_battle",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-11",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"逃走的意义",	"0",	"\u{3000}\u{3000}我们在苍雾的外围遇见了等待着我们的月冕小队，此时的多洛莉丝也终于从痛苦中缓和了过了，并找回了属于她的记忆，属于她的使命——她是一一枚钥匙，只有她能开通通往第三实验室的大门。"},
[100226] = {id = 100226,	scroll = 100020,	type = 2,	teacheid = 0,	name = "5-27",	cname = "救世主",	plot_first = "2_12",	plot_last = "0",	map = "0",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100225",	open = "100227_100020",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "第三研究院防衛隊的隊長，為了保護核心區的核心，啟動了防禦系統，使得我們有二十四小時的準備時間來攻破第三研究院，但眼下，被命名為【耶夢加得】的巨蛇是我們目前最大的阻礙。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_2-12",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-12",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"救世主",	"0",	"\u{3000}\u{3000}第三研究院防卫队的队长，为了保护核心区的核心，启动了防御系统，使得我们有二十四小时的准备时间来攻破第三研究院，但眼下，被命名为【耶梦加得】的巨蛇是我们目前最大的阻碍。"},
[100227] = {id = 100227,	scroll = 100020,	type = 2,	teacheid = 0,	name = "5-28",	cname = "幕間Ⅱ",	plot_first = "2_13",	plot_last = "0",	map = "0",	bgm = "20-Battle-Warehouse2_MP3",	unlock = "0_1",	front = "100226",	open = "100228_100021",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_10,1_100001_2000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "第三研究院防衛隊的成員們在蒼霧的影響下漸漸失去了自己的記憶，但是，不知道有什麼力量、什麼東西、什麼想法，讓她們一直在苦苦支撐著、支撐著……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_2-13",	npctype = 0,	npcbanmove = "0",	playnumber = 9,	recomlevel = 0,	bgpicture = "dialog_2-13",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"幕间Ⅱ",	"0",	"\u{3000}\u{3000}第三研究院防卫队的成员们在苍雾的影响下渐渐失去了自己的记忆，但是，不知道有什么力量、什么东西、什么想法，让她们一直在苦苦支撑着、支撑着……"},
