[900201] = {id = 900201,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-1",	cname = "流浪貓與偽通感者們",	plot_first = "YM/YM_1_1",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "0",	open = "900202_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "【嫉妒】事件之後，艾吉斯召集了駕駛員處理薩爾市近海的防衛與清理工作，在會議之後主持會議的洛尼絲要求月冕的隊長摩根勒菲單獨留下來，並遞給了她一張女孩的照片，洛尼絲希望她能救救照片中的女孩——芙露露。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_1",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
