[900203] = {id = 900203,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-3",	cname = "海岸上哭泣的少女",	plot_first = "YM/YM_1_3",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900202",	open = "900204_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "作戰結束，月冕小隊將海面上大部分的水母殲滅，但是不知為何，除了摩根勒菲之外，所有人似乎都被那螢光色的海水迷住了，她們駐留在海灘上久久不忍離去……",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_3",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
[900204] = {id = 900204,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-4",	cname = "以小小溫暖對抗",	plot_first = "YM/YM_1_4",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900203",	open = "900205_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "莉莉絲帶來了搜集來的芙露露的資料，還有她父母的資料，莉莉絲斷定芙露露通過幻象看到了什麼，並沉浸在其中，她想讓芙露露擺脫幻想。在她為“魔術”做準備的時候，從洛尼絲那裡得知芙露露擅自幻化參與了收尾工作。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_4",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
[900205] = {id = 900205,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-5",	cname = "少女停止了流淚",	plot_first = "YM/YM_1_5",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900204",	open = "900206_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "海灘上最後僅存的水母們開始了【進化】，原罪們瘋狂地集中在一起，把一小塊區域化作了怪誕的絞肉機，它們展開最後了的反擊。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_5",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
[900206] = {id = 900206,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-6",	cname = "芙露露看見了",	plot_first = "YM/YM_1_6",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900205",	open = "900207_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "月冕小隊作為緊急處理小隊參與了討伐戰，洛尼絲提議讓芙露露隨著大部隊撤離，但是月冕小隊遵從了芙露露的意志，讓她留在了戰場。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_6",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
[900207] = {id = 900207,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-7",	cname = "月冕",	plot_first = "YM/YM_1_7",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900206",	open = "900208_900200",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "最初的芙露露難以融入月冕的戰鬥節奏，在摩根勒菲和莉莉絲的引導下，第一次主動進入【偽通感】狀態，與斯卡蒂一起擊破了巨大原罪的觸手。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 2,	recomlevel = 0,	bgpicture = "juqingtu_7",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
[900208] = {id = 900208,	scroll = 900200,	type = 105,	teacheid = 0,	name = "1-8",	cname = "第四位魔法少女",	plot_first = "YM/YM_1_8",	plot_last = "0",	map = "0",	bgm = "35-Hazy",	unlock = "1_910004",	front = "900207",	open = "0",	player = "0",	monster = "0",	consume = "4_100001_0",	frequency = 0,	condition = "0",	reward = "1_100000_30,1_100001_3000",	drop = "0",	victory = "0",	roleexp = "0",	failure = "0",	introduction = "戰後，芙露露收穫了即使不用通感也能體會到的溫暖感情——寄給“月冕”的感謝信，並且暫時地找到了自己想要幹的事情，沒有目標的她想要繼承父母的目標，也是所有人的最終目標，驅逐原罪，奪回人類的家園。",	prohibit = "0",	scrollmappos = "0",	prohibitskill = "0",	picture = "dialog_s-1",	npctype = 0,	npcbanmove = "0",	playnumber = 4,	recomlevel = 0,	bgpicture = "juqingtu_8",	reserve = "0",	dangerousenemy = "0_0",	npcheads = "0",	promptdialog = "0",	returnfloorid = 0,	continuouscombattype = 0,	activitypreview2 = "0",	"0",	"0",	"0"},
